import React,{component, Component} from 'react';
import "./toolbar.css"

class Toolbar extends Component{

    render(){
        return(
            <div className="top">
                <a href="something" class="button3">Button</a>
                <button>Todos</button>
                <button>Login</button>
            </div>
        )
    }


}

export default Toolbar;
